import React from 'react';
import './Home.css';
// import './Image/Log1.jpg'; // gives image path
// import Home from './Image/Log2.jpg'; // gives image path
// import Home from './Image/Trac.jpg'; // gives image path

const Home = () => {
  return (
    <div className="home-container">
      <div className="carousel">
        <div className="carousel-item">
          <img src="./Image/Log1.jpg" alt="Image 1" />
        </div>
        <div className="carousel-item">
          <img src="Log2.jpg" alt="Image 2" />
        </div>
        <div className="carousel-item">
          <img src="Trac.jpg" alt="Image 3" />
        </div>
      </div>
      <div className="content">
        <h1>Welcome to my website!</h1>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla facilisi. Sed eget nunc ut nisl finibus vestibulum. Duis vitae lectus enim. Morbi in risus a ex consequat tincidunt. Ut maximus justo eu ex malesuada, id dictum tellus pharetra. Sed nec mauris euismod, bibendum purus sed, eleifend orci.</p>
      </div>
    </div>
  );
};

export default Home;
